function removeUser(a){$.ajax({url:"/users/"+a,type:"DELETE"}).done(function(b,c,d){console.log("Deleted user "+a)}).fail(function(a,b,c){console.log(a,b,c)}).always(function(){getAllUsers()})}function getAllUsers(){$.ajax({url:"/update",type:"GET",ifModified:!0}).done(function(a,b,c){if(200==c.status){$("#users").empty();var d=$("#usersList").html(),e=Handlebars.compile(d);$("#users").append(e(a))}}).fail(function(a,b,c){console.log(a,b,c)}).always(function(){console.log("Ajax complete")})}$(document).ready(function(){var a=$("#users");a.on("click",".delete",function(){var a=$(this).data("id");removeUser(a),$(this).parent().remove()}),setInterval(function(){getAllUsers()},1e4)});